"use strict";

var chatContainer = document.querySelector(".chat__list");
var triggersParents = document.querySelectorAll('.account__dropdown-item');
var triggers = document.querySelectorAll("[data-trigger='tabTrigger']");
var tabs = document.querySelectorAll("[data-tab='tabItem']");
var triggerClassName = "account__categories-btn--active";
var tabClassName = "account-tab--active";

// tabs
triggers.forEach(function (link) {
  // get path
  link.addEventListener("click", function (e) {
    var path = e.currentTarget.dataset.path;

    // switch classes on btn
    triggers.forEach(function (link) {
      link.classList.remove(triggerClassName);
    });
    triggersParents.forEach(function (item) {
      item.classList.remove('dropdown--active');
      console.log('lop');
    });
    e.currentTarget.classList.add(triggerClassName);
    e.currentTarget.parentElement.classList.add('account__dropdown-item--active');

    // switch classes on tabs
    tabs.forEach(function (tab) {
      tab.classList.remove(tabClassName);
    });
    document.querySelector("[data-target=\"".concat(path, "\"]")).classList.add(tabClassName);
    setTimeout(function () {
      chatContainer.scrollIntoView({
        block: "end",
        behavior: "smooth"
      });
    }, 1000);
  });
});
if (chatContainer) {
  chatContainer.scrollIntoView(false);
}
