/**
 * Меняет текст в элементе
 * в зависимотсти от ширины экрана
 * */
function dynamicChangeTextInElem(elem, width, oldText, newText) {
  var arrayFromNodelist = Array.from(elem);
  arrayFromNodelist.forEach(function (item) {
    if (document.documentElement.clientWidth < width) {
      item.textContent = newText;
    } else {
      item.textContent = oldText;
    }
  });
}
dynamicChangeTextInElem(cardDiscountBtns, 1200, "Добавить в корзину", "В корзину");
window.addEventListener("resize", function () {
  dynamicChangeTextInElem(cardDiscountBtns, 1200, "Добавить в корзину", "В корзину");
});
