var mailingInput = document.querySelector(".mailing__input");

// 'Динамическая' смена текста у placeholder
function switchInputPlaceholderText(input, textOld, textNew, width) {
  if (input) {
    if (document.documentElement.clientWidth < width) {
      input.placeholder = textNew;
    } else {
      input.placeholder = textOld;
    }
  }
  return;
}
switchInputPlaceholderText(mailingInput, "Введите адрес электронной почты", "Email", 575);
