var orderLabels = document.querySelectorAll(".order-form__delivery");
var orderFormLegend = document.querySelector(".order-form__legend--accordion");
var container = document.querySelector(".order-form__input-wrap--accordion");
if (orderFormLegend) {
  orderFormLegend.addEventListener("click", function () {
    if (orderFormLegend.dataset.open !== "true") {
      orderFormLegend.dataset.open = "true";
      orderFormLegend.classList.add("order-form__legend--active");
      container.style.maxHeight = "".concat(container.scrollHeight, "px");
      container.style.visibility = "inherit";
    } else {
      orderFormLegend.dataset.open = "false";
      container.style.maxHeight = "";
      container.classList.remove("order-form__input-wrap--accordion--active");
      orderFormLegend.classList.remove("order-form__legend--active");
    }
  });
}

/**
 * Первый аргумент - массив.
 * Второй аргумент - строка с названием класса.
 * Назначает переданный класс по клику на текущий элемент массива
 * и удаляет класс у остальных элементов.
 * */
var toggleClassOnClick = function toggleClassOnClick(items, className) {
  items.forEach(function (item) {
    item.addEventListener("click", function (e) {
      var currentBtn = e.currentTarget;
      items.forEach(function (item) {
        if (item !== currentBtn) item.classList.remove(className);
      });
      item.classList.add(className);
    });
  });
};
toggleClassOnClick(orderLabels, "order-form__delivery--active");
